import React, { useState } from "react";
import Button from "../UI/Button.jsx";
import Card from "../UI/Card.jsx";
import classes from "./AddUsers.module.css";

const AddUsers = () => {
  const [userName, setUserName] = useState("");
  const [userAge, setUserAge] = useState("");
  const addUser = (event) => {
    event.preventDefault();
    console.log(userAge, userName);
  };
  const userNameChange = (event) => {
    setUserName(event.target.v);
  };
  const userAgeChange = (event) => {
    setUserAge(event.target.value);
  };
  return (
    <Card className={classes.input}>
      <form action="" onSubmit={addUser}>
        <label htmlFor=" username">Username</label>
        <input id="username" type="text" onChange={userNameChange} />
        <label htmlFor="age">Age</label>
        <input id="age" type="number" onChange={userAgeChange} />
        <Button type="submit">Add U ser</Button>
      </form>
    </Card>
  );
};

export default AddUsers;
